import styled from "styled-components";

const Container = styled("div")`
width: 100vw:
height: 300px;
background-color: white;


margin-top: 100px;
padding: 10px 0;

display: flex;
flex-direction: column;
justify-content: center;
align-items: center;
`

const Roadmap = () => {
    return (
        <Container>
            <h1>
                Roadmap
            </h1>
            <h2>
                Q1 2022
            </h2>
            <ul>
                    <li>
                        Lorem Ipsum
                    </li>
            </ul>
        </Container>
    )
}

export default Roadmap;
